import { fromJS } from 'immutable';

const defaultState = fromJS({
    articleList: [{
        id: 1,
        title: '请记住杨绛先生的这4句话（深度文字）',
        desc: '人的一生是一场漫长而坎坷的旅程，多去汲取别人人生的经验，我们在路途上就能少走些弯路，受益终生。 杨绛先生的这4句话，字字都是珠玑，读懂了它们，就...'
    }]
});

export default (state = defaultState, action) => {
    switch (action.type) {
        default:
            return state;
    }
}
